                {
                  "Name": "Default",
                  "SecurityLevel": 2
                },
                {
                  "Name": "FormFilling",
                  "SequenceNumber": 1,
                  "SecurityLevel": 2
                }
              ]
            },
            {
              "Name": "Sign",
              "LocalizedFriendlyName": "Signér",
              "AppliesTo": [
                {
                  "Name": "Signing",
