            },
            {
              "Name": "ArchiveDelete",
              "LocalizedFriendlyName": "Slett arkiv"
            }
          ],
          "_links": {
            "roledefinition": "http://www.altinn.no/api/metadata/roledefinitions/SISKD"
          }
        }
      },
      "RoleOperation": {
        "title": "RoleOperation",
        "description": "",
        "type": "object",
        "properties": {
          "Name": {
            "type": "string"
          },
          "LocalizedFriendlyName": {
            "type": "string"
          },
          "AppliesTo": {
            "type": "array",
            "items": {
              "$ref": "#/components/schemas/ProcessStep"
            }
          }
        },
        "example": {
          "Name": "Write",
          "LocalizedFriendlyName": "Skriv",
          "AppliesTo": [
            {
              "Name": "Default",
              "SecurityLevel": 2
            },
            {
              "Name": "FormFilling",
              "SequenceNumber": 1,
              "SecurityLevel": 2
            }
          ]
        }
      },
      "AttachmentRule": {
        "description": "Rules for an attachment",
        "type": "object",
        "properties": {
          "AttachmentRuleId": {
            "description": "Id of the Attachment Rule.",
            "type": "integer",
